"    {\n",
"      mplot(xaxis = FALSE, yaxis = FALSE, col.background = \"#E6E6E6\", alp.background = 0.8, lwd.backlines = 0, alp.border = 1, col.border = \"#BEBEBE\") # Add a subgraph with custom background color and border\n",
