"    {\n",
"      mplot(ylim = c(min(area), max(area)), ydigits = 0, lwd.backlines = 0, yaxis.pos = FALSE, main = \"Area Size\", alp.background = 0, xaxis = FALSE, cex.axis = 1, cex.main = .8) # Add a subgraph with custom y-axis limits and labels\n",
